import axios from "axios"
import {useEffect,useState} from "react"
import { useNavigate } from "react-router-dom";
import { checkAuth,logout } from "../functions/Authorization";
import Room from "../components/Room"
import CreateRoom from "../components/CreateRoom"
import liveIcon from "../resources/live.png"
import scheduleIcon from "../resources/schedule.png"
import searchIcon from "../resources/search.png"
import profileIcon from "../resources/profile.png"
import "../styles/main.css"

function Home(){


    const [rooms,setRooms] = useState([]);
    const navigate = useNavigate();
    

    useEffect(()=>{
        checkAuth(navigate)
        getRooms(setRooms);  
    // eslint-disable-next-line react-hooks/exhaustive-deps
    },[]);

    

    return(
        <div>
            <header>
                <div id="header">
                    <span>
                        <h1>Buzz.live</h1>
                        <span><hr /> <span>.</span></span>
                    </span>
                </div>
            </header>
            
             {/* <button onClick={logout.bind(this,navigate)}>Logout</button> */}


             {/* <CreateRoom getRooms={getRooms} setRooms={setRooms}/> */}
             <section>
                <ul className="nav" onClick={toggleNav}>
                    <li><a href="/"><img src={liveIcon} alt="live-icon"/></a></li>
                    <li><a href="/"><img src={scheduleIcon} alt="live-icon"/></a></li>
                    <li><a href="/"><img src={searchIcon} alt="live-icon"/></a></li>
                    <li><a href="/"><img src={profileIcon} alt="live-icon"/></a></li>
                </ul>
                 <div id="rooms-container">
                    {rooms.map((room,index)=>{
                        return(<Room key={room._id} title={room.title} description={room.description} npeople={room.npeople} language={room.lang} img={room.img} roomID={room.roomID} />)
                    })}
                 </div>
             </section>
        </div>
    )
}

function toggleNav(){
    const listItems = document.querySelectorAll(".nav li")
}




function getRooms(setRooms){
    axios.get("http://localhost:5000/getRoom").then((res)=>{
        setRooms(res.data)
    })
}

export default Home;
